// Define some steppers and the pins the will use<br />
AccelStepper stepper1(4, 6, 7, 8, 9);<br />
AccelStepper stepper2(4, 13, 12, 12, 10);
void setup()<br />
{<br />
stepper1.setMaxSpeed(120.0);<br />
stepper1.setAcceleration(100.0);<br />
stepper1.moveTo(60);
<code >stepper2.setMaxSpeed(120.0);
stepper2.setAcceleration(100.0);
stepper2.moveTo(60);</code>
}
void loop()<br />
{<br />
// Change direction at the limits<br />
if (stepper1.distanceToGo() == 0)<br />
stepper1.moveTo(-stepper1.currentPosition());<br />
if (stepper2.distanceToGo() == 0)<br />
stepper2.moveTo(-stepper2.currentPosition());<br />
stepper1.run();<br />
stepper2.run();<br />
}
